class Table extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            isLoaded: true,
            error: null,
            data:[]
         }
    }
    componentDidMount(){
        console.log("hello");




fetch("/api/v2/tickers")
  .then((response) => response.json())
  .then((result) => {
      this.setState({
          data: result,
          isLoaded:true
      });
    //   result.map(res=>(console.log(res.name)))
      
  })
  .catch((error) => {
      this.setState({
          isLoaded:true,
          error
      })
  });
    }
    display=()=>{
        console.log(typeof(this.state.data));
