        // for(var key in this.state.data){
        //     row.push(this.state.data[key]);
        // }
        // console.log(row);
    }
    render() { 
        const {error, isLoaded, data} = this.state;
        

        if (error){
            return <div>Error: {error.message}</div>
        } else if(!isLoaded){
            return <div>Loading...</div>
        }
        else{
            // let row = [];
            // for(var key in data){
            //     row.push()
            let row=[];
            row.push(data);
            const table = row.map((finaldata)=>
            <tr>
            <td>{finaldata}</td>
            <td>{finaldata.name}</td>
            <td>{finaldata.last}</td>
            <td>{finaldata.buy}{finaldata.sell}</td>
            <td>{finaldata.volume}</td>
            <td>{finaldata.base_unit}</td>
        </tr>
            )
        return ( <div>
            <button onClick={this.display}>click</button>
            <table>
                <tr>
                    <th>#</th>
                    <th>name</th>
                    <th>Last</th>
                    <th>Buy/Sell Price</th>
                    <th>volume</th>
                    <th>base_unit</th>
                </tr>
               
                {/* {Object.entries(data).forEach(finaldata=>(
                    <tr>
                    <td></td>
                    <td>{finaldata.name}</td>
                    <td>{finaldata.last}</td>
                    <td>{finaldata.buy}/{finaldata.sell}</td>
                    <td>{finaldata.volume}</td>
                    <td>{finaldata.base_unit}</td>
                    </tr>
                )
                   
                )} */}
                {/* {data.map(finaldata =>(
                    <tr>
                        <td></td>
                        <td>{finaldata.name}</td>
                        <td>{finaldata.last}</td>
                        <td>{finaldata.buy}{finaldata.sell}</td>
                        <td>{finaldata.volume}</td>
                        <td>{finaldata.base_unit}</td>
                    </tr>
                ))} */}
                {table}
            </table>
        </div> );
        }
    }
}
 
export default Table;
